import react from 'react';

//arrow func for creating func comp home that returns an html
const Home=()=>{
    return(
        <div>
            <title>BMI Ca</title>
            <div id="form">
                <p>Enter your height in centimeters</p>
                <input type="number" placeholder='Height in Cms' id="height"></input>
                <p>Enter your weight in kilograms</p>
                <input type="number" placeholder='Weight in Kgs' id="weight"></input>
            </div>
        </div>
    )
}

export default Home
